	function loadadd(id, cnt, r_cnt) {
		var path = document.getElementById('i' + id).src;
		if (path.indexOf('plus.jpg') != -1) {
			$('#odd' + id).html('<div align="center"><img src="/img/loading6.gif" /></div>');
